import React from 'react';

import './buttons.css';

function SignIn() {
  return (
    <React.Fragment>
      <div className="sign-in">
        <button>Sign in</button>
      </div>
      <div className="getting-started">
        <button>Getting Started</button>
      </div>
    </React.Fragment>
  );
}

export default SignIn;
